import React from 'react';
import { Navbar, Nav, Image, ButtonToolbar, ButtonGroup, Button, FormGroup, FormControl } from 'react-bootstrap';

class SearchBar extends React.Component {
  render() {
    return (
      <Navbar>
        <Navbar.Header>
          <Navbar.Brand>
            <a href="#home">React-Bootstrap</a>
          </Navbar.Brand>
        </Navbar.Header>
        <Nav>
        <Button bsStyle="outline-primary">Neues Spiel</Button>
          <form>
            <FormGroup>
              <FormControl
                type="text"
                placeholder="Suche"
              />
            </FormGroup>
          </form>
        </Nav>
      </Navbar>

    );
  }
}

export default SearchBar;
